import React from 'react';

function Footer() {
  return (
    <footer className="bg-gray-200 text-center py-4">
      <p className="text-gray-600 text-sm">
        Built with <span role="img" aria-label="love">❤️</span> by Antone King
      </p>
    </footer>
  );
}

export default Footer;
